			tChart1.Axes.Bottom.Title.Text = "Group 1";
//			tChart1.Axes.Bottom.Labels.DateTimeFormat = "dd'.'MM'.'yyyy HH:mm";
			int labelHeight;
			using (Graphics g = CreateGraphics())
			{
				SizeF size = g.MeasureString(tChart1.Axes.Bottom.Labels.Text, tChart1.Axes.Bottom.Title.Font.DrawingFont, tChart1.Axes.Bottom.MaxLabelsWidth());
				labelHeight = (int)Math.Ceiling(size.Height);
			}

			//this also happens inside of loop
			newAxis = tChart1.Axes.Custom.Add();
			newAxis.Title.Text = "Group 2";
			newAxis.Grid.Visible = false;
			newAxis.Title.Angle = tChart1.Axes.Bottom.Title.Angle;
			newAxis.Title.Font.Size = tChart1.Axes.Bottom.Title.Font.Size;
			newAxis.Title.Font.Color = tChart1.Axes.Bottom.Title.Font.Color;
			newAxis.Title.Font.DrawingFont = tChart1.Axes.Bottom.Title.Font.DrawingFont;
			newAxis.Labels.Font.Size = tChart1.Axes.Bottom.Labels.Font.Size;
			newAxis.Labels.Font.Color = tChart1.Axes.Bottom.Labels.Font.Color;
			newAxis.Labels.Font.DrawingFont = tChart1.Axes.Bottom.Labels.Font.DrawingFont;
			newAxis.Labels.DateTimeFormat = tChart1.Axes.Bottom.Labels.DateTimeFormat;
			newAxis.Labels.MultiLine = tChart1.Axes.Bottom.Labels.MultiLine;
			newAxis.PositionUnits = Steema.TeeChart.PositionUnits.Pixels;
			newAxis.RelativePosition = -(labelHeight + newAxis.Ticks.Length + titleHeight + 20 + tChart1.Panel.MarginBottom);
			tChart1.Panel.MarginBottom = -newAxis.RelativePosition;
			newAxis.Horizontal = true;

			tChart1.Series[0].CustomHorizAxis = tChart1.Axes.Bottom;
			tChart1.Series[1].CustomHorizAxis = newAxis;
		}

		private void checkBox1_CheckedChanged(object sender, EventArgs e)
		{
			foreach (Steema.TeeChart.Styles.Line item in tChart1.Series)
			{
				item.Smoothed = checkBox1.Checked;
			}
		}
	}
}
